pub enum FieldDescriptorProto_Label {
    LABEL_OPTIONAL = ,
    LABEL_REQUIRED = ,
    LABEL_REPEATED = ,
}

pub enum MethodOptions_IdempotencyLevel {
    IDEMPOTENCY_UNKNOWN = ,
    NO_SIDE_EFFECTS = ,
    IDEMPOTENT = ,
}

pub enum ProtobufError {
    IoError(io::Error),
    WireError(WireError),
    Utf8(str::Utf8Error),
    MessageNotInitialized {
        message: &'static str,
    },
}

pub fn make_vec_accessor<M,
                         V>(&'static str,
                            for<'a>fn(: &'a M) -> &'a Vec<V::Value>,
                            for<'a>fn(: &'a mut M) -> &'a mut Vec<V::Value>)
-> FieldAccessor where M: Message + 'static, V: ProtobufType + 'static

pub fn make_option_accessor<M,
                            V>(&'static str,
                               for<'a>fn(: &'a M) -> &'a Option<V::Value>,
                               for<'a>fn(: &'a mut M)
                                   -> &'a mut Option<V::Value>)
-> FieldAccessor where M: Message + 'static, V: ProtobufType + 'static

pub fn make_simple_field_accessor<M,
                                  V>(&'static str,
                                     for<'a>fn(: &'a M) -> &'a V::Value,
                                     for<'a>fn(: &'a mut M)
                                         -> &'a mut V::Value) -> FieldAccessor
where M: Message + 'static, V: ProtobufType + 'static

pub enum ReflectFieldRef<'a> {
    Optional(Option<ReflectValueRef>),
    Repeated(&'a dyn ReflectRepeated),
    Map(&'a dyn ReflectMap),
}

pub enum Field_Cardinality {
    CARDINALITY_UNKNOWN = ,
