    CARDINALITY_REQUIRED = ,
    CARDINALITY_REPEATED = ,
}

pub enum UnknownValue {
    Fixed32(u32),
    Fixed64(u64),
    Varint(u64),
    LengthDelimited(Vec<u8>),
}

pub enum UnknownValueRef<'o> {
